// src/App.js
import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import Login from "./components/Auth/Login";
import Signup from "./components/Auth/Signup";
import PetForm from './components/PetRegistration/PetForm';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
  <Route path="/register-pet" element={<PetForm />} />
  <Route path="/generate-qr" element={<GenerateQR />} />
        <Route path="/my-pets" element={<MyPets />} />
        <Route path="/scan" element={<Scan />} />
         <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
      </Routes>
    </div>
  );
}

// Temporary placeholder components
function Home() { return <h1>Home Page</h1>; }
// function RegisterPet() { return <h1>Register Pet</h1>; }
function MyPets() { return <h1>My Pets</h1>; }
function Scan() { return <h1>Scan QR</h1>; }
// function Login() { return <h1>Login</h1>; }

export default App;
